<template>
    <div class="row">
        <div class="col-xs-12">
            <div class="row">
                <div class="col-xs-12">
                    <a href="" ref="downloadlink">
                        <img id="result-img" src="../assets/images/loading-spinner.svg" alt="">
                    </a>
                </div>
            </div>
            <div class="row">
                <div class="col-xs-12">
                    <p class="text-center">เซฟรูปไปเปลี่ยนเป็นรูปโปรไฟล์ได้เลย</p>
                </div>
            </div>
            <div class="row">
                <div class="col-xs-12">
                    <button class="btn btn-default btn-lg btn-block" @click="reset">เลือกรูปภาพใหม่</button>
                </div>
            </div>
            <div class="processing-area" style="display:none;">
                <canvas width="1500" height="1500" id="result-canvas" style="display: none;"></canvas>
            </div>
        </div>
    </div>    
</template>

<script>
export default {
    props: ['result'],
    mounted(){
        let canvas = document.getElementById('result-canvas')
        let ctx = canvas.getContext('2d')

        let pngUrl = ""

        let image = new Image()
        let imageOverlay = new Image()

        image.src = this.result
        imageOverlay.src = "data:image/png;base64,"
        image.onload = () => {
            ctx.fillStyle = 'white'
            ctx.fillRect(0, 0, 1500, 1500)
            ctx.drawImage(image, 0, 0, image.width, image.height, 0, 0, image.width, image.height)
            ctx.drawImage(imageOverlay, 0, 0, image.width, image.height, 0, 0, image.width, image.height);
            pngUrl = canvas.toDataURL("image/png")
            $('#result-img').attr('src', pngUrl).attr('download', 'Strong(LYC2017).png')
            $(this.$refs.downloadlink).attr('href', pngUrl)
        }
    },
    methods: {
        reset(){
            this.$emit('reset')
        }
    }
}
</script>